import React from "react";

import LockPersonTwoToneIcon from "@mui/icons-material/LockPersonTwoTone";

function Navbar() {
	return (
		<div className="navbar bg-primary">
			<h1>
				<LockPersonTwoToneIcon fontSize="large" style={{ colour: "red" }} />
				Keeper
			</h1>
		</div>
	);
}

export default Navbar;
